window.bookSummaryJSON = "<p><b>I signed up to marry a stranger on reality TV.</b></p> <p>Turns out the bride is someone I know, and I'm pretty sure she still hates me for what happened between us in high school...</p> <p>I knew the terms: marry a stranger on the spot, handpicked by experts just for me. But that's not what's happening.</p> <p>My bride is no stranger. And she's wearing a black dress reminiscent of the one she wore the last time we spoke… at prom. Surely she's gotten over what happened at prom by now.</p> <p>Except... it only takes me about five minutes to realize she hasn't. And now, I'm married to the one woman I did wrong in my life. But she still trembles at my touch.</p> <p>Either this is about to be the biggest mistake of my life or the greatest second chance in history.</p> <p>And all of America gets to watch it...</p> <p>Meeting at the Altar <i>is a sweet, small-town, second chance, marriage of convenience rom-com full of sizzling chemistry while keeping the bedroom door closed. It's the third standalone story in Kristine W. Joy's Brothers of Lucky Seven Ranch series.</i></p>"; 
